import React from "react";
import kapMembers from "../assets/kapMembers.png";
import teamPic_1 from "../assets/teamPic_1.png";
import "../styles/teamPage.css";

function TeamPage() {
    const teamImages = [
        { src: teamPic_1, alt: "Team Member 1" },
        { src: teamPic_1, alt: "Team Member 2" },
        { src: teamPic_1, alt: "Team Member 3" },
        { src: teamPic_1, alt: "Team Member 4" },
    ];

    return (
        <div className="teamPage">
            <div className="teamHeader">
                <h1>Sangguniang Barangay</h1>
                <h2>Leaders Committed to Community Service</h2>
                <p>
                    The Sangguniang Barangay is dedicated to governing and improving our community.
                    Through leadership, transparency, and service, we ensure the well-being and development of our barangay.
                </p>
            </div>

            <div className="teamImg">
                <img src={kapMembers} alt="Kapitan and Kagawads" className="kapMembers" />
            </div>

            <div className="teamMembers">
                {teamImages.map((member, index) => (
                    <img key={index} src={member.src} alt={member.alt} className="teamPic" />
                ))}
            </div>
        </div>
    );
}

export default TeamPage;
